import './App.css';
import './css/normalize.css';
import './css/bootstrap.min.css';
import './css/mdb.min.css';
import React, { Component } from 'react';

export default function App() {

    return (
        <></>
    );
}

export class Navbar extends Component {

    constructor(props) {
        super(props);
        this.state = {
            menu: false
        };
        this.toggleMenu = this.toggleMenu.bind(this);
        this.location_icon = require("./img/icon_where.png");
    }

    render () {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark navbar-color fixed-top">
            <button className="navbar-toggler third-button" type="button" data-toggle="collapse"
                data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false"
                aria-label="Toggle navigation">
                <div className="animated-icon3"><span></span><span></span><span></span></div>
            </button>

            <a className="navbar-brand" href="index.html"><img src={require("./img/nav_logo.png")} alt="logo" /></a>

            {/* <!--網頁選單--> */}
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <div className="container">
                    <div className="row">
                        {/* <!--top icon--> */}
                        <div className="row navbar-nav nav-icon">
                            <div className="col-11"></div>
                            <a className="col" href="#" style={{ PointerEvent: "none" }}><img src={location_icon} alt="location" /></a>
                            <div className="col location">
                                <p className="text-center"></p>
                            </div>
                        </div>

                        {/* <!--導航選單--> */}
                        <ul className="col navbar-nav ml-auto justify-content-end">
                            <li className="nav-item"><a id="home_link" className="nav-link">首頁</a></li>
                            <li className="nav-item"><a id="portfolio_link" className="nav-link">作品集</a></li>
                            <li className="nav-item"><a id="certificate_link" className="nav-link"
                                href="certificate.html">證書集</a></li>
                            <li className="nav-item"><a id="contact_link" className="nav-link">聯絡方式</a></li>
                        </ul>
                    </div>
                </div>
            </div>
        </nav>
    );
    };
}
